import React from "react";
import Progress from "progress";
function Bottom(props){
    
    return (
    <div>
       <h4>Accuracy</h4>
        <Progress
            accu={props.accu}
        />
        <h4>Words per minute(WPM)</h4>
        <Progress
            accu={props.wpm}
        />
    </div>
    );
}
export default Bottom;
